import React, { useState } from 'react';

import {} from './ProductListElements'

const ProductList = () => {
    const [products, setProducts] = useState([]);

    axios.get(`${process.env.REACT_APP_API_URL}/getAllProfesionalUsers`)
        .then((response) => {
            setProfesionals(response.data)
        })
        .catch((error) => {
            console.error(error);
        });

    return (
        <ProductListContainer>
            <ProductListWrapper>
            {products.map((item) => {
                return (
                    <ProductInfo> 
                        <ImgProduct src={item.img} alt='imageProfesional'/>
                        <InfoWrap>
                            <Info id='fullName'>{item.firstName} {item.lastName}</Info>
                            <Info>{item.profession} - {item.location}</Info>    
                            <Info id='categories'>{item.categories.join(', ')}</Info>
                        </InfoWrap>
                    </ProductInfo>
                    );
                })}
            </ProductListWrapper>
        </ProductListContainer>
    )
}

export default ProductList
